DROP TABLE IF EXISTS `clients`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `clients` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `code` varchar(16) DEFAULT '0000000000000',
  `name` varchar(255) DEFAULT '',
  `surname` varchar(255) DEFAULT NULL,
  `email` varchar(45) DEFAULT NULL,
  `since` date NOT NULL DEFAULT '2009-01-01',
  `expiry` date NOT NULL DEFAULT '2012-12-01',
  `birthDate` date NOT NULL,
  `address` varchar(255) DEFAULT NULL,
  `nation` varchar(45) DEFAULT NULL,
  `phone` varchar(50) DEFAULT NULL,
  `monthly` double NOT NULL DEFAULT '0',
  `photo` blob,
  `beginsusp` date DEFAULT NULL,
  `endsusp` date DEFAULT NULL,
  `msgsusp` varchar(5000) DEFAULT NULL,
  `notes` blob,
  `parent` varchar(16) DEFAULT NULL,
  `lastCreditReset` date DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

